import React from 'react';

const App = () => {
  const [nome, setNome] = React.useState('');

  function handleChange(event) {
    setNome(event.target.value);
  }

  return (
    <form>
      <label htmlFor="nome"></label>
      <input id="nome" type="text" value={nome} onChange={handleChange}></input>
    </form>
  );
};

export default App;
